import { useForm } from "react-hook-form";
import TextField from '@mui/material/TextField';
import React, { useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { useNavigate,useLocation ,useParams} from "react-router-dom";
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { Description, Password } from '@mui/icons-material';
import { postUser} from '../../features//User/UserSlice';
import { putProduct } from "../../features/Product/ProductSlice";

const UpdateProduct = (props) => {    const { state } = useLocation();

    let product1 = state.p;
    console.log(product1)   
    const dispatch = useDispatch();
    const nav=useNavigate()

const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    const newProduct = {
        id: product1.id, // חובה לכלול את ה-ID לעדכון המוצר הנכון
        name: data.get('name'),
        description: data.get('description'),
        imgUrl: data.get('imgUrl'),
        price: data.get('price'),
    }

    dis(putProduct(newProduct));
    nav('/ProductList');
}

    return (
        <Box
        sx={{
          marginTop: 8,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
        }}
      >
        <Avatar sx={{ m: 1, bgcolor: 'lightpink' }}>
          {/* <LockOutlinedIcon /> */}
        </Avatar>
        <Typography component="h1" variant="h5" >
          Sign In
        </Typography>
<Box sx={{ maxWidth: 400, margin: 'auto', padding: 3, boxShadow: 3 }}>
<Typography variant="h5" component="h2" gutterBottom>
</Typography>         
            <form onSubmit={handleSubmit(onSubmit)}>

                <>
                    <TextField
                    value={product1.name}
                        id="filled-basic"
                        label="name:"
                        variant="outlined"
                        fullWidth
                        margin="normal"                        onChange={(e) => setProduct({ name:e.target.value, description: product.description, price:product.price,imgUrl:product.imgUrl})}
                        {...register("name", { required: "field is required", pattern: /^[A-Za-z]+$/i })}
                    />
                    {errors.name?.type === 'required' && <p>{errors.name.message}</p>}
                    {errors.name?.type === 'pattern' && <p>enter in english</p>}
                    {dirtyFields.name && <p>✔️</p>}
                </>
                <>
                    <TextField
                                        value={product1.description}
                        id="filled-basic"
                        label="description:"
                        type="description"
                        variant="outlined"
                        fullWidth
                        margin="normal"                        onChange={(e) => setProduct({ name:product.name, description:e.target.value, price:product.price,imgUrl:product.imgUrl})}
                        {...register("description",{required: "field is required"})}
                    />
                   {errors.password?.type === 'required' }
                    {dirtyFields.password && <p>✔️</p>}
                </>
                <>
                    <TextField
                                        value={product1.price}

                        id="filled-basic"
                        label="price:"
                        type="price"
                        variant="outlined"
                        fullWidth
                        margin="normal"                        onChange={(e) => setProduct({ name:product.name, description: product.description, price:e.target.value,imgUrl:product.imgUrl})}
                        {...register("price", {
                            required: 'enter a price ',
    
                        })}
                    />
                    {errors.telephone && <p>{errors.telephone.message}</p>}
                    {dirtyFields.telephone && <p>✔️</p>}
                </>
                <>
                    <TextField
                                        value={product1.imgUrl}

                              variant="outlined"
                              fullWidth
                              margin="normal"
                        id="filled-basic"
                        label="imgUrl:"
                        onChange={(e) => setProduct({ name:product.name, description: product.description, price:product.price,imgUrl:e.target.value})}
                        {...register("imgUrl", { required: "field is required", pattern: /^[A-Za-z]+$/i })}
                    />
                    {dirtyFields.name && <p>✔️</p>}
                </>
               
                <Button
              color='inherit'
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2,bgcolor:'lightpink' }}
            >
              Sign In
            </Button> 
                       </form>
            </Box>            </Box>

        
    );
}

export default UpdateProduct;
